export default function IoNode({ data }) {
    return (
      <div style={{
        transform: 'skewX(-20deg)',
        background: '#fff3e0',
        padding: '8px',
        border: '2px solid #555',
        fontFamily: 'monospace'
      }}>
        <div style={{ transform: 'skewX(20deg)' }}>{data.label}</div>
      </div>
    );
  }
